    dic = {1: [0, 2, 2, 3, 53, 52], 2: [4, 5, 6, 7, 50, 51], 3: [8, 9, 10, 11, 48, 49], 4: [12, 13, 14, 15, 47, 46], 5: [16, 17, 18, 19, 44, 45], 6: [20, 21, 22, 23, 42, 43], 7: [24, 25, 26, 27, 40, 41], 8: [28, 29, 30, 31, 38, 39], 9: [32, 33, 34, 35, 36, 37]}

    def count_ways_in_car(car_seat):
        net = 0
        for com in dic.values():
            count = sum((1 for xx in com if car_seat[xx] == '0'))
            if count >= X:
                net += comb(count, X)
        return net
    total_ways = 0
    for car_seat in car_seats:
        total_ways += count_ways_in_car(car_seat)
    return total_ways

